import React from "react"

function Footer () {
    return (
        <div className>
            <a href="https://github.com/MarilynPapadopoulos"><i class="fab fa-github"></i></a>
            <a href="https://www.linkedin.com/in/marilyn-papadopoulos/"><i class="fab fa-linkedin-in"></i></a>
            <a href="https://www.linkedin.com/in/marilyn-papadopoulos/">Place Holder</a>
        </div>
    )

}

export default Footer
